import ExpenseItem from "./components/ExpenseItem/ExpenseItem";
import "Expenses.css";

const Expenses = ({ expenses }) => {
  return (
    <div>
      {expenses.map((expense) => (
        <ExpenseItem
          title={expense.title}
          amount={expense.amount}
          date={expense.date}
        />
      ))}
    </div>
  );
};

export default Expenses;
